    "\n",
    "Hemos observado un patrón estacional en la cantidad de viajes de los clientes. Se evidencia un aumento desde los días **martes hasta el sábado**, y se registra un pico significativo durante el mes de **septiembre de 2023**. Por lo tanto, es probable que **el día con la mayor cantidad de viajes de clientes sea un sábado de septiembre**. Este comportamiento sugiere que los clientes de Cyclistic, tanto casuales como miembros, **tienden a agruparse principalmente durante los meses más cálidos**.\n",
