  {
   "cell_type": "markdown",
   "id": "ce6c7ad0",
   "metadata": {
    "papermill": {
     "duration": 0.034628,
     "end_time": "2024-05-10T23:47:18.264929",
     "exception": false,
     "start_time": "2024-05-10T23:47:18.230301",
     "status": "completed"
    },
